 function generateTask(group,sd){
 
var gr = new GlideRecord('x_sthc_research_research_work_order');
gr.initialize();
gr.setValue('assignment_group', group);
gr.setValue('due_date',current.due_date);
gr.priority = current.priority;
gr.short_description = sd;
gr.description = current.short_description + current.nonmed_version;
gr.setValue('linked_version', current.sys_id);
gr.assignment_key = sd;
gr.insert();
gs.addInfoMessage("Task for " + sd + " Created");
 }

